function BudgetTotal() {
  return (
    <>
      <div className="budget__title">
        Available Budget in <span className="budget__title--month">%Month%</span>:
      </div>
      <div className="budget__value">+ 2,345.64</div>
    </>
  )
}

export default BudgetTotal
